import React, { Component } from "react";
import "../style/signup.css";

export class SignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "email",
      password: "password",
      passwordBis: "passwordBis",
      name: "name",
      lastname: "lastname"
    };
  }

  updateEmailField = e => {
    this.setState({
      [e.target.name]: e.target.value
    });
  };

  render() {
    const { email, password, passwordBis, name, lastname } = this.state;
    return (
      <div className="container">
        <h1>
          {JSON.stringify({ email, password, passwordBis, name, lastname })}
        </h1>
        <div className="contain">
          email:
          <input type="email" name="email" onChange={this.updateEmailField} />
        </div>
        <div className="contain">
          password:
          <input
            type="password"
            name="password"
            onChange={this.updateEmailField}
          />
        </div>
        <div className="contain">
          repeat password:
          <input
            type="password"
            name="passwordBis"
            onChange={this.updateEmailField}
          />
        </div>
        <div className="contain">
          name:
          <input type="text" name="name" onChange={this.updateEmailField} />
        </div>
        <div className="contain">
          lastname:
          <input type="text" name="lastname" onChange={this.updateEmailField} />
        </div>
        <div className="contain">
          <input type="submit" value="Soumettre" />
        </div>
      </div>
    );
  }
}

export default SignUp;
